import React from 'react';
import { Route } from 'react-router-dom';
import TransfertForm from '../forms/TransfertForm.js';

export default function transfer(obj) {
  return (
    <div>
      <Route exact path="/transfer" component={() =>
        <>
          <p>Transfer page</p>
          {obj.connected() || obj.acceptNotLoginFnc() ?
            <>
              Transfert page
              <TransfertForm onSend={obj.handleSendTransfertForm} />
            </>
            : "Connection requise"}
        </>
      } />
    </div>
  )
}
